    export default function reducerProduct (state = initialState, action){
        let { type, payload } = action;

        switch (type) {
         
         
          case 'filter':
              if (payload === 'all categories'){
                return state
            }
              let products = initialState.products.filter((product) => 
                product.category=== payload 
              );
              return { products };
              

            case 'reset':
              return initialState;
        
            default:
              return state;
          }
        }
      
    
export const filterProducts = (category) => {
    return {
      type: 'filter',
      payload: category
    }
  };


  
  export const resetCategories = () => {
    return {
      type: 'reset'
    };
  };
   


    